import React from 'react'
import Cards from '../Cards'
import MainSection from '../MainSection'
import '../MainSection.css';


function Home() {

    
    return (
        <div>
            <MainSection/>
            
            <Cards 
                status = {true}
                url = {`get/${5}`}
            />
        </div>
    )
}

export default Home
